//!
//! Each data set correspond to the storage state for its corresponding block just before the
//! staking initialisation.
//!
//! it has been generated using the following code at commit
//! dc92587bea4032e0a0fc96785bfd9aa17c95459e
//!
//! ```nocompile
//! fn print_storage(i: u32) {
//! 	let mut storage = vec![];
//! 	let mut current_key = vec![];
//! 	while let Some(key) = sp_io::storage::next_key(&current_key) {
//! 		storage.push((key.clone(), sp_io::storage::get(&key).unwrap()));
//! 		current_key = key;
//! 	}
//! 	println!("const _{}: &[(&[u8], &[u8])] = {:?};", i, storage);
//! }
//!
//! #[test]
//! fn get_states() {
//! 	let mut ext = ExtBuilder::default().build();
//!
//! 	for index in 1..10u32 {
//! 		ext.execute_with(|| {
//! 			print_storage(index - 1);
//! 			System::set_block_number((index).into());
//! 			Timestamp::set_timestamp(System::block_number() * 1000);
//! 			Session::on_initialize(System::block_number());
//! 		});
//! 	}
//! }
//! ```

